import React from "react";
import { Row, Col } from "antd";
class Avatar extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <>
        <Row>
          <Col span={8}>
            <div>
              <img src={`url("./image/avatar1.jpg")`}></img>
            </div>
          </Col>
          <Col span={8}></Col>
          <Col span={8}></Col>
        </Row>
      </>
    );
  }
}

export default Avatar;
